import React from 'react'
import { Box, Typography } from '@mui/material'

const MealDetails = ({ name, foods }) => {
  return (
    <Box sx={{ width: '100%', display: 'flex', flexDirection: 'column', border: 'solid 1px black' }}>
      <Typography variant='h2' component="h2" align='center' >{name}</Typography>
      {

        foods.map((food) =>
          <Box sx={{ width: '100%', display: 'flex', justifyContent: 'space-between' }}>
            <Typography variant="p" component="p" align='center' sx={{width:'100%'}}>{food}</Typography>
            <Typography variant="p" component="p" align='right' sx={{ width: '100%' }} >20</Typography>
          </Box>
        )
      }
    </Box>
  )
}

export default MealDetails
